import { Route } from "react-router-dom";
import Adminheader from "../components/Adminheader";
import AddBook from "./AddBook";
// import AddBook from "./AddBook";


export function AdminDashboard(){
    return(
<div>
    <Route>
        <Adminheader>
          <Route exact path="admin/addbook" element={ <AddBook/> }/>

        </Adminheader>

    </Route>
</div>
    )
}
